import sys
sys.setrecursionlimit(10**6)

class Solution:


    # @param A : string
    # @return an integer
    def solve(self, A):

        return self.checkPalin(A,0,len(A)-1)   


    def checkPalin(self, A, start, end):

        if start > end:
            return 1
        elif A[start] != A[end]:
            return 0
        else:
            return self.checkPalin(A,start+1,end-1)

obj = Solution()
A = ""
#print(len(A))
print(obj.solve(A))
